import React, {Component} from 'react'
import '../App.css'
import uparrow from '../up arrow.jpg'
import downarrow from '../down arrow.jpg'
import {Extract} from './listextractor'
import {Personlistmaker} from './personlist.js'
import {VitalsTable} from './vitalstable'
import {Links,Route} from 'react-router-dom'
import List from '../docpat.json'
//import for register form
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';

export class Alerts extends Component{
    constructor(props){
        super(props)
        this.state={
            name_list:[],
            id_list:[]
        }
        this.show_list=this.show_list.bind(this);
        //this.close_list=this.show_list.bind(this); binding here uses prev state, therefore bound in onClick
    }
    show_list(){
        this.setState({
            name_list:['Sumanth','Saketh','Kunar','Sunni']
        })
        //console.log(this.state.name_list)
    }
    close_list(){
        this.setState({
            name_list:[]
        })
        console.log("on change works!")
    }
    
    render(){
        return(
        <div>
            <div className="alert_box_title">
                Alerts
            </div>
            <div className="patients">
                Sumanth
            </div>
            <div className="patients">
                Rakesh
            </div>
            <div className="patients">
                Murkhi
            </div>
            <div className="patients">
                Kishore
            </div>
            {/* <div className="patients">
               <Personlistmaker name_list={this.state.name_list} />
           </div> */}
        </div>
        )
    }
}

export class Patients extends Component{
    constructor(props){
        super(props)
        this.state={
            name_list:[],
            id_list:[]
        }
        this.show_list=this.show_list.bind(this);
        //this.update_state=this.update_state.bind(this);
        //this.close_list=this.show_list.bind(this); binding here uses prev state, therefore bound in onClick
    }
    
    // extract(name){
    //     console.log("inisde list ectractor method")
    //     let name_list=[],id_list=[],i=0
    //     List.forEach((p)=>{
    //         if(p.name===name){
    //             name_list=p.patients.map((e)=>e[0])
    //             id_list=p.patients.map((e)=>e[1])
    //         }
    //     })
    //     console.log(id_list)
    //     return name_list
    // }


    show_list(temp_list,tempid_list){
        this.setState({
            name_list:temp_list,
            id_list:tempid_list
        })
        // this.setState({
        //     name_list:['a','c']
        // })
    }



    update_state(){
                // let temp_list=['Sumanth','Rakesh','Saketh','Rakim','Kunar']
              //  alert("reached the fn!")    
        // if(this.state.name_list){
            // let temp_list=[]
            // let tempid_list=[]
            let [temp_list,tempid_list]=Extract("Kumar")
            //alert("reached the fn!")
            //console.log(temp_list);
            //this.show_list(temp_list)
            this.setState({
                name_list:temp_list,
                id_list:tempid_list
            })
            //alert(this.state.name_list)
        // }

    }

    close_list(){
        this.setState({
            name_list:[],
            id_list:[]
        })
        console.log("on change works!")
    }
    render(){
        return(
        <div>
        
            <div className="patient_box_title">
               Registered Patients
               <img src={downarrow} className="down" onClick={this.update_state.bind(this)}  height="20px" width="20px" role="button" tabIndex="0" alt="exapand"></img>
               <img src={uparrow}  className ="up"onClick={this.close_list.bind(this)} height="20px" width="20px" role="button" tabIndex="0" alt="exapand"></img>
           </div>
            <div className="patients">
                <Personlistmaker  name_list={this.state.name_list} id_list={this.state.id_list} /> 
           </div> 
        </div>
        )
    }
}


//registration ui
           

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(3),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

export  function Register() {
  const classes = useStyles();

  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
        <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          Sign up
        </Typography>
        <form className={classes.form} noValidate>
          <Grid container spacing={2}>
            <Grid item xs={12} >
              <TextField
                autoComplete="name"
                name="name"
                variant="outlined"
                required
                fullWidth
                id="name"
                label="name"
                autoFocus
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="email"
                label="Email Address"
                name="email"
                autoComplete="email"
              />
            </Grid>
            </Grid>
            <Grid item xs={12} sm={6} >
              <TextField
                autoComplete="age"
                name="age"
                variant="outlined"
                required
                fullWidth
                id="age"
                label="age"
                autoFocus
              />
            </Grid>
             {/* <Grid item xs={12} sm={6} >
              <TextField
                autoComplete="sex"
                name="sex"
                variant="sex"
                required
                fullWidth
                id="sex"
                label="sex"
                autoFocus
              />
            </Grid> */}
            <Grid item xs={12} sm={6} >
              <TextField
                autoComplete="height"
                name="height"
                variant="height"
                required
                fullWidth
                id="height"
                label="height"
                autoFocus
              />
            </Grid>

          
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
          >
            Sign Up
          </Button>
          <Grid container justify="flex-end">
            <Grid item>
              <Link href="#" variant="body2">
                Already have an account? Sign in
              </Link>
            </Grid>
          </Grid>
        </form>
      </div>
      <Box mt={5}>
        <Copyright />
      </Box>
    </Container>
  );
}
